import React, { Component } from 'react'
import './index.css'
import { Input } from 'antd'

class AddKit extends Component{
  render(){
    return(
      <div className='div-card-AddKit'>
        <div className='linhaTexto-AddKit'>
          <h1 className='h1-AddKit'>Gerenciar kit</h1>
        </div>

          <div className='linha1-AddKit'>
          <div className='div-nome-AddKit'>
            <div className='div-text-AddKit'>Item:</div>
            <Input
              className='input-100'
              placeholder="Digite o nome"
              name='nome'
              // value={this.state.nome}
              onChange={this.onChangeNormal}
              allowClear
            />
          </div>

          <div className='div-cnh-AddKit'>
            <div className='div-textCNH-AddKit'>Validade CNH:</div>
            <Input
              className='input-100'
              placeholder="DD/MM/AAAA"
              name='cnh'
              // value={this.state.cnh}
              onChange={this.onChange}
              allowClear
            />
          </div>
        </div>
      </div>
    )
  }
}

export default AddKit
